import React from 'react';
import { Link } from 'react-router-dom';

const Home: React.FC = () => {
  return (
    <div style={{ padding: '1rem' }}>
      <h2>Welcome to SilentWave Real-Time Chat</h2>
      <p>Try opening multiple browser windows or private windows to test concurrency!</p>
      <nav>
        <Link to="/login">Login</Link> | <Link to="/signup">Sign Up</Link> | <Link to="/chat">Chat</Link>
      </nav>
    </div>
  );
};

export default Home;
